import React, { Component } from "react";
import { addToTab, updateTabDetails} from '../redux.js';
import { connect } from 'react-redux';
import { Link } from "react-router-dom";
import './../style/dojodossier.css'

class DojoDossierMain extends Component {
    constructor(props) {
      super(props);
      };
    render() {
      const displayTab= this.props.tabItems.map((items,index)=>{

         return (
            <div>
                <div className="tab">
                    <button className="tablinks" onclick="openCity(event, 'London')">{items.name}</button>
                </div>
                <div id={items.id} className="tabcontent">
                    <p>{items.City}</p> 
                    <p>{items.Hobbies}</p> 
                </div>
            </div> 
         )

      })

      return (
          <div className="outerdiv">
           {displayTab}


          </div>
      );
    }
  }

  const mapStateToProps = (state) => ({
    tabItems:state.tabItems
  })

  const mapDispatchToProps = (dispatch) => ({
    addToTab: (payload) => dispatch(addToTab(payload)),
    updateTabDetails: (payload) => dispatch(updateTabDetails(payload))
  })

  export default connect(
    mapStateToProps,
    mapDispatchToProps
  )(DojoDossierMain);
